Nice Browning A-5 12ga Semi-Auto Shotgun, Belgium Made - $550/trade

Used but not abused, very CLEAN and tight for its age, and built like a true Browning (Browning having the reputation of being like the Mercedes of firearms)

note that a "smaller/secondary" screw on the underside of the stock is missing, but the stock is firmly held in place and this does not affect functionality; may be able to get that little screw for a small fee from Browning;
